let arr2 = []

for (let i = 0; i < 8; i++) {
    const element = array[i];

}


function Line({ number,state }: LineProps) {
    return (
        <div className='Line'>
            <div className='Line'>{number}
            </div>
            {arr.map((el:number) => (
                <Cell
                key={el}
                colorCell = {state && el % 2 ==0 ? true : false}
                />
            ))}
        </div>

    );
};

